CREATE TABLE "FRECUENCIAS" (
	"COOPERATIVA"	TEXT,
	"DESTINO"	TEXT,
	"HORA"	TEXT,
	"JORNADA" 	TEXT,
	PRIMARY KEY("COOPERATIVA","DESTINO","HORA")
);

CREATE TABLE "USUARIOS" (
	"CEDULA"	TEXT,
	"NOMBRE"	TEXT NOT NULL,
	"NUMERO_CELULAR"	TEXT,
	"CONTRASEÑA"	TEXT,
	"ROL"	TEXT,
	PRIMARY KEY("CEDULA")
);

CREATE TABLE "REGISTRO" (
	"COOPERATIVA"	TEXT,
	"USUARIO"	TEXT,
	"DESTINO"	TEXT,
	"HORA"	TEXT,
	"FECHA"	TEXT NOT NULL,
	"FRECUENCIA"	TEXT,
	"NUM_PASAJEROS"	INTEGER,
	"TIPO_FREC"	TEXT,
	"VALOR" 	INTEGER,
	"NUM_TICKET"	TEXT,
	PRIMARY KEY("COOPERATIVA","HORA","FECHA","USUARIO", "NUM_TICKET"),
	FOREIGN KEY("COOPERATIVA", "DESTINO", "HORA") REFERENCES "FRECUENCIAS"("COOPERATIVA", "DESTINO", "HORA"),
	FOREIGN KEY("USUARIO") REFERENCES "USUARIOS"("CEDULA")
);

CREATE TABLE "REGISTRO_EXTRA" (
	"COOPERATIVA"	TEXT,
	"USUARIO"	TEXT,
	"DESTINO"	TEXT,
	"HORA"	TEXT,
	"FECHA"	TEXT NOT NULL,
	"FRECUENCIA"	TEXT,
	"NUM_PASAJEROS"	INTEGER,
	"TIPO_FREC"	TEXT,
	"VALOR" 	INTEGER,
	"NUM_TICKET"	TEXT,
	PRIMARY KEY("COOPERATIVA","HORA","FECHA","USUARIO", "NUM_TICKET"),
	FOREIGN KEY("USUARIO") REFERENCES "USUARIOS"("CEDULA")
);











